init.script:
var text = ROYGBIV.getText("info");
var githubText = ROYGBIV.getText("github");
if (ROYGBIV.isMobile()){
  ROYGBIV.setText(text, "touch: rotate surface\ntwo finger pinch: zoom");
}
ROYGBIV.onTextClick(githubText, function(){
  var redirectWindow = window.open('https://github.com/oguzeroglu/ROYGBIV', '_blank');
  redirectWindow.location;
});
ROYGBIV.setTextColor(githubText, "lime");
ROYGBIV.setTextColor(text, "lime");
ROYGBIV.setTextAlpha(text, 0.5);
ROYGBIV.setTextAlpha(githubText, 0.5);
ROYGBIV.disableDefaultControls(true);
ROYGBIV.setCameraPosition(0, 50, 1500);
ROYGBIV.lookAt(0, 0, 0);
ROYGBIV.globals.axisZ = "z";
ROYGBIV.globals.leftKey = "Left";
ROYGBIV.globals.rightKey = "Right";
ROYGBIV.globals.surface = ROYGBIV.getObject("surface1");
ROYGBIV.globals.reusableVector = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.positionCtrlFunc = function(obj, objName){
  ROYGBIV.getPosition(obj, ROYGBIV.globals.reusableVector);
  if (ROYGBIV.globals.reusableVector.y <= -500){
    ROYGBIV.setPosition(obj, ROYGBIV.getRandomInteger(-200, 200), ROYGBIV.getRandomInteger(400, 500), ROYGBIV.getRandomInteger(-20, 70));
    ROYGBIV.resetObjectVelocity(obj);
  }
}
ROYGBIV.globals.cameraPositionVector = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.mousewheelCallback = function(deltaX, deltaY){
  if (Math.abs(deltaX) < Math.abs(deltaY)){
    ROYGBIV.getCameraPosition(ROYGBIV.globals.cameraPositionVector);
    if (ROYGBIV.globals.cameraPositionVector.z >= 100 && ROYGBIV.globals.cameraPositionVector.z <= 1500){
      ROYGBIV.translateCamera(ROYGBIV.globals.axisZ, deltaY);
      ROYGBIV.getCameraPosition(ROYGBIV.globals.cameraPositionVector);
      if (ROYGBIV.globals.cameraPositionVector.z < 100){
        ROYGBIV.setCameraPosition(0, 50, 100);
      }
      if (ROYGBIV.globals.cameraPositionVector.z > 1500){
        ROYGBIV.setCameraPosition(0, 50, 1500);
      }
    }
  }
}
ROYGBIV.globals.pinchCallback = function(delta){
  if (delta > 0){
    ROYGBIV.globals.mousewheelCallback(0, -5);
  }else{
    ROYGBIV.globals.mousewheelCallback(0, 5);
  }
}
ROYGBIV.setScreenMouseWheelListener(ROYGBIV.globals.mousewheelCallback);
ROYGBIV.setScreenPinchListener(ROYGBIV.globals.pinchCallback);
ROYGBIV.runScript("loop");
this.stop();

loop.script:
ROYGBIV.executeForEachObject(ROYGBIV.globals.positionCtrlFunc);

if (ROYGBIV.isKeyPressed(ROYGBIV.globals.leftKey)){
  ROYGBIV.rotate(ROYGBIV.globals.surface, ROYGBIV.globals.axisZ, 0.01);
}else if (ROYGBIV.isKeyPressed(ROYGBIV.globals.rightKey)){
  ROYGBIV.rotate(ROYGBIV.globals.surface, ROYGBIV.globals.axisZ, -0.01);
}else if (ROYGBIV.getCurrentTouchCount() == 1){
  ROYGBIV.rotate(ROYGBIV.globals.surface, ROYGBIV.globals.axisZ, 0.01);
}
